    points: 5,
    objectID: 1,
  },
];

function App() {

  return (
    <div className="d">
      <List />
    </div>

  );
}
const List = () =>{
  return (

    list.map(i => {


        <div key={i.objectID}>
          <h1>{i.title}</h1>
          <a href={i.url}>{i.url}</a>

        </div>

    })

  )
}

export default App;
